import React from "react";
function CardText(props) {
  return (
    <div
      className={`card bg-transparent mx-auto m-md-3  border-white border-5 ${
        props.heading ? "" : "d-none d-md-block"
      }`}
      style={{ width: "18rem" }}
    >
      {props.img}?
      <img src={props.imgUrl} className="card-img-top" alt="img"></img>:{null}}
      <div className="card-body">
        <h5 className="card-title">{props.heading}</h5>
        <p className="card-text">{props.text}</p>
      </div>
    </div>
  );
}

export default CardText;
